let headerSpace = $('header').outerHeight();
let infiniteHeight = $(window).height() - headerSpace - $('.btns-top').innerHeight();

var MagicScrollOptions = {
		height: infiniteHeight,
		width: '100%',
		items: 4,
		step: 1,
		speed: 80,
		orientation: 'vertical',
		scrollOnWheel: !0,
		draggable: !1,
		keyboard: !1,
		easing: 'cubic-bezier(.13,.62,.55,.93)',
		arrows: 'off',
		onReady: function () {
			$('.MagicScroll').addClass('ready');
			var e,
				o,
				r = $('.scrolling-text-content .item');
			r.mouseover(function () {
				return (
					(e = $(this).data('bg-color')),
						(o = $(this).data('fx')),
						$('#wrapper').css('background-color', e).addClass('text-hover'),
						$('.hover-image')
							.eq(o - 1)
							.hasClass('hoverOut')
							? ($('.hover-image').removeClass('hoverOut'),
								$('.hover-image')
									.eq(o - 1)
									.addClass('hovered'))
							: $('.hover-image')
								.eq(o - 1)
								.addClass('hovered'),
						!1
				);
			}),
				r.mouseleave(function () {
					return (
						(e = $(this).data('bg-color')),
							(o = $(this).data("fx")),
							$('#wrapper').removeClass('text-hover'),
							$('.hover-image').removeClass('hovered'),
							$('.hover-image')
								.eq(o - 1)
								.addClass('hoverOut'),
							setTimeout(function () {
								$('.hover-image').removeClass('hoverOut');
							}, 250),
							!1
					);
				});
			if (window.innerWidth <= 1024 || window.innerWidth === 1080) {
				$('#wrapper').css('background-color', $('#1').data('bg-color'));
			}
		},
	},
	MagicScrollMobileOptions = {
		height: infiniteHeight,
		width: '100%',
		items: $(window).height() >= 801 ? 4 : 3,
		step: 'auto',
		orientation: 'vertical',
		scrollOnWheel: !0,
		draggable: !0,
		keyboard: !1,
		easing: 'cubic-bezier(.13,.62,.55,.93)',
		arrows: 'off',
		onMoveEnd: function () {
				let id = arguments[0].items[0];
				$('#wrapper').css('background-color', $(`#${id + 1}`).data("bg-color"));
		},
	};

$('.scrolling-text-content .item').on('mouseleave', function(){
	if($(window).width() > 1024) {
		$('#wrapper').css('background', '#D8E377');
	}
})
$(window).on('resize', function(){
	if($(window).width() < 1025) {
		$('#wrapper').css('background', '#D8E377');
	}
})
